    return (
        <Router>
            <Routes>
            <Route path="/" exact component={HomePage} />
                <Route path="/pumps/:pumpId" component={PumpDetail} /> {/* Dynamic route for pump details */}
                {/* Add more routes as needed */}
            </Routes>
        </Router>
    );
};

export default App;
